/*Table structure for table `reservation` */

DROP TABLE IF EXISTS `reservation`;

CREATE TABLE `reservation` (
  `id` INT(4) UNSIGNED NOT NULL AUTO_INCREMENT,
  `hotelId` SMALLINT(1) UNSIGNED NOT NULL,
  `reservationType` VARCHAR(1) NOT NULL DEFAULT 'I',
  `arrival` DATE NOT NULL,
  `departure` DATE NOT NULL,
  `nights` TINYINT(3) UNSIGNED NOT NULL,
  `adults` TINYINT(3) UNSIGNED NOT NULL DEFAULT '1',
  `children` TINYINT(3) UNSIGNED DEFAULT '0',
  `roomTypeId` SMALLINT(2) NOT NULL,
  `quantity` SMALLINT(6) UNSIGNED NOT NULL DEFAULT '1',
  `roomId` VARCHAR(4) DEFAULT NULL,
  `vipCode` CHAR(1) DEFAULT '3',
  `sourceId` INT(6) UNSIGNED NOT NULL,
  `roomRate` DECIMAL(10,2) NOT NULL,
  `totalRoom` DECIMAL(10,2) NOT NULL,
  `paymentDue` DATE DEFAULT NULL,
  `paymentType` TINYINT(3) UNSIGNED DEFAULT NULL,
  `voucher` VARCHAR(10) DEFAULT NULL,
  `hotelInstructions` VARCHAR(120) DEFAULT NULL,
  `guestInstructions` VARCHAR(120) DEFAULT NULL,
  `status` CHAR(1) NOT NULL DEFAULT 'T',
  `createdBy` VARCHAR(3) DEFAULT NULL,
  `creationDate` DATETIME DEFAULT NULL,
  `updatedBy` VARCHAR(3) DEFAULT NULL,
  `lastUpdate` DATETIME DEFAULT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=INNODB DEFAULT CHARSET=latin1 AVG_ROW_LENGTH=214 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='Reservation Room';

/*Data for the table `reservation` */

/*Table structure for table `reservationstatus` */

DROP TABLE IF EXISTS `reservationstatus`;

CREATE TABLE `reservationstatus` (
  `id` SMALLINT(2) UNSIGNED NOT NULL AUTO_INCREMENT,
  `status` CHAR(1) DEFAULT NULL,
  `description` CHAR(15) DEFAULT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=INNODB DEFAULT CHARSET=latin1 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='Reservation status';

