/*Table structure for table `room` */

DROP TABLE IF EXISTS `room`;

CREATE TABLE `room` (
  `id` INT(4) UNSIGNED NOT NULL AUTO_INCREMENT,
  `hotelId` TINYINT(1) UNSIGNED NOT NULL,
  `roomTypeId` SMALLINT(2) NOT NULL,
  `roomNumber` CHAR(4) NOT NULL,
  `location` VARCHAR(50) NOT NULL,
  `description` VARCHAR(50) NOT NULL,
  `roomRate` DECIMAL(10,0) NOT NULL,
  `maxBeds` TINYINT(1) NOT NULL,
  `connection` CHAR(4) DEFAULT NULL,
  `reservationId` INT(4) DEFAULT NULL,
  `houseKeepingStatus` CHAR(1) DEFAULT NULL,
  `status` CHAR(1) NOT NULL,
  `createdBy` CHAR(3) NOT NULL,
  `creationDate` DATE NOT NULL,
  `updatedBy` CHAR(3) DEFAULT '',
  `lastUpdate` DATE DEFAULT NULL,
  PRIMARY KEY  (`id`)
